import CheckIcon from '../../asset/icons/box/CheckIcon.js';
import InProgressIcon from '../../asset/icons/box/InProgressIcon.js';

function StepIcon(props) {
  const { active, completed } = props;

  const Icon = completed ? CheckIcon : InProgressIcon;
  const color = completed ? 'bg-primary' : 'bg-gray';

  return (
    <div className={`step flex flex-col items-center mx-10 ${color}`}>
      <Icon className='text-white' />
    </div>
  );
}
